const AccountCard = ({ account }) => {
  <div className="card">
    <div>
      {account?.publicKey && <div>{account.publicKey.toString()}</div>}
      {account?.privateKey && <div>{account.privateKey.toString()}</div>}
    </div>
    {account.balance && <div>{account.balance} </div>}
  </div>;
};

export default AccountCard;
